import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return ( //this is JSX - legg til flere HTML classes med className i App
    <div className="App"> 
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
         YO!
        </p>

      </header>
    </div>
  );
}

export default App;
